import React, { useState } from 'react';
import { Header } from './Components/Header';
import { CitySelect } from './Components/CitySelect';
import { SpotifyEmbed } from './Components/SpotifyEmbed';

const cityOptions = {
  "new-york": {
    label: "New York",
    value: "new-york",   
    id: 7644
  },
  "los-angeles": {
    label: "Los Angeles",
    value: "los-angeles",    
    id: 17835
  },
  "columbus": {
    label: "Columbus",
    value: "columbus",   
    id: 9480
  }
};


function App() {

  const [ city, setCity ] = useState('new-york');
  const cityData = cityOptions[city];


  //Generate the Songkick API url
  function getSongkickUrl(songkickMetroId){   
    const songkickAPIKey = 'RpuYqxFiPPsJPs5l';
    let songkickUrl = "https://api.songkick.com/api/3.0/metro_areas/" + songkickMetroId + "/calendar.json?apikey=" + songkickAPIKey;
    console.log(songkickUrl);
  };

  getSongkickUrl(cityData.id);


  //Fetch list of gigs in selected city
  const [userData, setUserData] = useState({});

  return (
    <div className="h-full">
      <Header />
      <p>City: {cityData.label}</p>       
      <p>ID: {cityData.id} </p>  
      <CitySelect
        city={city}
        setCity={setCity}
        cityOptions={cityOptions}
      />

      {/*Pass spotify ID into here*/}
      <SpotifyEmbed />
    </div>
  );
}

export default App;
